const e=JSON.parse(`[{"number":101,"question":"Which of the following TCAs has a greater inhibitory effect on norepinephrine reuptake compared with serotonin reuptake?","options":{"A":"Doxepin","B":"Nortriptyline","C":"Imipramine","D":"Amitriptyline","E":"Clomipramine"},"correct_answer":"B","explanation":"Among the TCAs, secondary amines such as Nortriptyline are known to block the reuptake of norepinephrine and to a lesser extent, serotonin."},{"number":102,"question":"A 43-year-old woman on tamoxifen therapy develops symptoms of depression. Which of the following antidepressants is best indicated in her treatment?","options":{"A":"Bupropion","B":"Paroxetine","C":"Venlafaxine","D":"Fluoxetine","E":"Duloxetine"},"correct_answer":"C","explanation":"Venlafaxine is a weak CYP2D6 inhibitor and hence is the preferred agent in the treatment of depression in women receiving tamoxifen."},{"number":103,"question":"Which of the following statements regarding management of bipolar depression is/are true?","options":{"A":"Results from the Systematic Treatment Enhancement Program for Bipolar Disorder (STEP-BD) study showed higher rates of treatment-emergent affective switches with mood stabilizer + adjunctive antidepressant versus mood stabilizer + placebo.","B":"Results from the STEP-BD study showed the statistical difference in outcome by adding antidepressants to mood stabilizer when compared with mood stabilizers and placebo.","C":"STEP-BD data suggest that addition of intensive psychotherapy (cognitive behavior therapy, interpersonal therapy, and family focused therapy) to standard mood stabilizer treatment was no better than mood stabilizer treatment without these treatments.","D":"Quetiapine is FDA approved for the treatment of acute bipolar depression.","E":"All of the above"},"correct_answer":"D","explanation":"Quetiapine regular and extended-release tablets are indicated for the acute treatment of depressive episodes associated with bipolar disorder, type I and type II."},{"number":104,"question":"You see a 50-year-old patient with schizophrenia in community mental health setting. Which of the following is the most appropriate starting dose of haloperidol decanoate?","options":{"A":"100 mg","B":"50 mg","C":"300 mg","D":"200 mg","E":"250 mg"},"correct_answer":"A","explanation":"In patients stabilized on low daily oral haloperidol doses, the recommended dose of haloperidol decanoate is 10 to 15 times the previous daily oral dose."},{"number":105,"question":"Which of the following high-potency benzodiazepines is known to have long half-life?","options":{"A":"Diazepam","B":"Chlordiazepoxide","C":"Clonazepam","D":"Lorazepam","E":"Temazepam"},"correct_answer":"C","explanation":"Clonazepam has the longest half-life among the high-potency benzodiazepines."},{"number":106,"question":"The drug's side effect of orthostatic hypotension is related to its binding affinity for which receptor sites?","options":{"A":"H1 histaminergic receptors","B":"M1 Muscarinic receptors","C":"Alpha Adrenergic receptors","D":"Adrenergic receptors","E":"Serotonin 5-HT3 receptors"},"correct_answer":"C","explanation":"Risperidone's side effect of orthostatic hypotension is related to its binding affinity for alpha adrenergic receptors."},{"number":107,"question":"Bupropion is clinically useful in all of the following conditions EXCEPT:","options":{"A":"Major depressive disorder","B":"Tobacco cessation","C":"Opiate dependence","D":"Attention deficit hyperactivity disorder","E":"SSRI-induced sexual dysfunction"},"correct_answer":"C","explanation":"Bupropion has no role in opiate dependence."},{"number":108,"question":"Which of the following medications has demonstrated efficacy in the management of acute mania?","options":{"A":"Lamotrigine","B":"Gabapentin","C":"Carbamazepine ER (Equetro)","D":"Clonazepam","E":"All of the above"},"correct_answer":"C","explanation":"Carbamazepine extended release (Equetro) is FDA indicated in the management of bipolar, manic, or mixed states."},{"number":109,"question":"All of the following statements regarding treatment adherence during antidepressant therapy is true EXCEPT?","options":{"A":"Most patients discontinue antidepressants after consulting with their physician","B":"Most studies have found that 20% to 50% of patients discontinue antidepressant medication within the first few months of therapy","C":"Patients with comorbid posttraumatic stress disorder (PTSD) and anxiety disorders are less likely to adhere to antidepressant medications","D":"Tolerability issues during antidepressant treatment are one of the main reasons for non adherence","E":"Complicated dosing schedule negatively influences antidepressant adherence"},"correct_answer":"A","explanation":"Most patients discontinue on their own and seldom consult with physician."},{"number":110,"question":"Which of the following analgesics can be safely used in a patient on Selegiline transdermal patch?","options":{"A":"Tramadol","B":"Morphine","C":"Propoxyphene","D":"Codeine","E":"All of the above"},"correct_answer":"D","explanation":"Codeine has no drug-drug interaction with MAOIs and is safe for use."},{"number":111,"question":"Which of the following antidepressants has an ascending dose antidepressant response curve?","options":{"A":"Nefazodone","B":"Sertraline","C":"Paroxetine","D":"Mirtazapine","E":"Bupropion"},"correct_answer":"A","explanation":"Nefazodone and Venlafaxine have ascending dose-antidepressant response curves."},{"number":112,"question":"All of the following can be used in the treatment of neuroleptic-induced akathisia EXCEPT?","options":{"A":"Benzodiazepines","B":"Propranolol","C":"Clonidine","D":"Prochlorperazine","E":"Benztropine"},"correct_answer":"D","explanation":"Prochlorperazine can actually cause akathisia, thus cannot be used in management."},{"number":113,"question":"Which of the following statements is true regarding thyroid augmentation in unipolar depression?","options":{"A":"Serum levels of free T3 can clearly predict preferential response to thyroid augmentation","B":"The dose for T3 for thyroid augmentation is typically 25 to 50 mcg per day","C":"The evidence-base for T3 augmentation of TCAs and SSRIs is equal and comparable","D":"T3 augmentation is safe in the presence of cardiac disease","E":"An adequate trial of T3 augment is at least 4 to 6 weeks"},"correct_answer":"B","explanation":"The dose for T3 for thyroid augmentation is typically 25 to 50 mcg per day."},{"number":114,"question":"All of the following drugs could increase lithium levels when administered together EXCEPT?","options":{"A":"Verapamil","B":"Ramipril","C":"Hydrochlorothiazide","D":"Naproxen","E":"Theophylline"},"correct_answer":"E","explanation":"Theophylline increases lithium clearance and can lower serum levels."},{"number":115,"question":"You are called to evaluate a 54-year-old white woman with a history of bipolar disorder for altered mental status. Which of the following is the most likely explanation for her symptoms?","options":{"A":"As a result of a DDI","B":"Acute nutritional deficiency","C":"Development of new onset psychiatric symptoms","D":"Acute hepatic failure","E":"All of the above"},"correct_answer":"A","explanation":"Hyperammonemic encephalopathy can develop in patients on Depakote who are concurrently on topiramate."},{"number":116,"question":"After 4 weeks of aripiprazole therapy for a patient with high prolactin, you should particularly warn the patient of which of the following in the ensuing few months?","options":{"A":"Risk of worsening psychosis","B":"Risk of pregnancy","C":"Risk of blurred vision","D":"Nausea","E":"Risk of low bone mineral density"},"correct_answer":"B","explanation":"Patients may resume menses and are at risk of pregnancy if they do not use contraception."},{"number":117,"question":"All of the following statements regarding osmotic-controlled release oral delivery system (OROS) drug delivery technology are true EXCEPT?","options":{"A":"OROS technology allows for reduced peak and trough fluctuations","B":"OROS enables the use of an effective starting dose without the need for dose titration","C":"OROS technology does not facilitate reduced dosing frequency","D":"Long-acting oral Paliperidone and methylphenidate formulations utilize OROS technology","E":"Drugs delivered by OROS technology have lower potential for drug abuse"},"correct_answer":"C","explanation":"OROS technology releases drugs into the bloodstream over a 24-hour period and allows for once-a-day dosing."},{"number":118,"question":"Which of the following phases of the pharmacokinetic sequence is affected by pregnancy?","options":{"A":"Absorption","B":"Distribution","C":"Metabolism","D":"Excretion","E":"All of the above"},"correct_answer":"E","explanation":"Pregnancy affects absorption, distribution, metabolism, and excretion."},{"number":119,"question":"Which of the following antidepressants when administered during pregnancy has a statistically higher odds ratio for cardiovascular malformations?","options":{"A":"Fluoxetine","B":"Paroxetine","C":"Citalopram","D":"Sertraline","E":"Bupropion"},"correct_answer":"B","explanation":"First-trimester exposure to paroxetine appears to be associated with significant increase in the risk of cardiac malformation."},{"number":120,"question":"All of the following medications act as serotonin (5-HT) and norepinephrine reuptake inhibitors EXCEPT?","options":{"A":"Duloxetine","B":"Milnacipran","C":"Venlafaxine","D":"Mirtazapine","E":"Amitriptyline"},"correct_answer":"D","explanation":"Mirtazapine is not a dual reuptake inhibitor antidepressant."},{"number":121,"question":"Which of the following drugs has the greatest risk of QTc prolongation?","options":{"A":"Risperidone","B":"Quetiapine","C":"Ziprasidone","D":"Olanzapine","E":"Aripiprazole"},"correct_answer":"C","explanation":"Ziprasidone is associated with the greatest risk of QTc prolongation."},{"number":122,"question":"Which of the following MAOIs tends to be activating/stimulating?","options":{"A":"Tranylcypromine","B":"Phenelzine","C":"Selegiline","D":"Maprotiline","E":"Linezolid"},"correct_answer":"A","explanation":"Tranylcypromine resembles amphetamines and may produce more CNS stimulation than other MAOIs."},{"number":123,"question":"What percentage of patients enrolled in the Clinical Antipsychotic Trials of Intervention Effectiveness (CATIE) had metabolic syndrome?","options":{"A":"25%","B":"41%","C":"60%","D":"15%","E":"5%"},"correct_answer":"B","explanation":"The CATIE study found that approximately 41% of patients had metabolic syndrome."},{"number":124,"question":"Which of the following medications has little or no evidence in the treatment of fibromyalgia?","options":{"A":"Milnacipran","B":"Duloxetine","C":"Cyclobenzaprine","D":"Nonsteroidal anti-inflammatory drugs (NSAIDs)","E":"Pregabalin"},"correct_answer":"D","explanation":"NSAIDs have little or no evidence for use in the treatment of fibromyalgia."},{"number":125,"question":"Which of the following conclusions from the Sequenced Treatment Alternatives to Relieve Depression (STAR*D) study is most accurate?","options":{"A":"Patients who received cognitive-behavioral therapy (CBT) as either a switch or augmentation had lower response rates compared with pharmacotherapy.","B":"A majority of the patients achieved remission with antidepressant monotherapy within 4 weeks.","C":"The probability of relapse during continuation therapy increased as a function of the number of treatment trials required to achieve remission.","D":"Patients who do not respond to an SSRI have greater probability of responding to an antidepressant with a different mechanism of action versus another SSRI.","E":"All of the above"},"correct_answer":"C","explanation":"The probability of relapse during continuation therapy increased as a function of the number of treatment trials required to achieve remission."},{"number":126,"question":"All of the following laboratory screening tests are recommended before initiating carbamazepine for the treatment of bipolar disorder EXCEPT:?","options":{"A":"CBC.","B":"Hepatic function tests","C":"Renal functions tests","D":"ECG","E":"TSH"},"correct_answer":"D","explanation":"Routine ECGs are not recommended before initiating carbamazepine."},{"number":127,"question":"At what minimum dose does trazodone inhibit the serotonin transporter (SERT) and act as a potent antidepressant in addition to a hypnotic?","options":{"A":"100 mg","B":"250 mg","C":"150 mg","D":"300 mg","E":"600 mg"},"correct_answer":"C","explanation":"At doses above 150 mg per day, trazodone blocks the SERT, which has antidepressant properties."},{"number":128,"question":"The hematologic change most frequently associated with lithium therapy is?","options":{"A":"Leukopenia.","B":"Leukocytosis.","C":"Agranulocytosis.","D":"Aplastic anemia.","E":"Thrombocytopenia."},"correct_answer":"B","explanation":"Benign leukocytosis is sometimes observed with lithium therapy."},{"number":129,"question":"Which of the following treatment approaches would make sense for a patient with inactivation of both alleles of the CYP2D6 gene?","options":{"A":"Prescribe risperidone at approximately half the usual starting dose","B":"Prescribe risperidone at approximately one-half times the usual starting dose","C":"Lower the dose of citalopram while starting him on the usual adult starting dose of risperidone","D":"Decide not to use risperidone in this case","E":"Discard the information as not standard clinical care and do nothing"},"correct_answer":"A","explanation":"Poor metabolizers of CYP2D6 are at greater risk of developing adverse drug reactions at therapeutic doses, hence a lower dose of risperidone is recommended."},{"number":130,"question":"Which of the following statements regarding the use of Prazosin in the treatment of PTSD is/are true?","options":{"A":"Prazosin is the alpha blockers most lipid soluble","B":"Prazosin has shown to decrease recurrent distressing as well as to improve sleep quality in PTSD","C":"Prazosin is associated with the first-dose phenomenon","D":"Prazosin can increase the risk of priapism when concurrently administered with trazodone.","E":"All of the above"},"correct_answer":"E","explanation":"Prazosin is the most lipid-soluble alpha adrenergic blocker and has demonstrated efficacy and safety in the treatment of nightmares and insomnia in PTSD."},{"number":131,"question":"As per the ADA/APA consensus guidelines, all of the following are recommended metabolic monitoring guidelines for patients either starting or changing atypical antipsychotics EXCEPT?","options":{"A":"Monitor body mass index (BMI) at baseline, 4, 8, and 12 weeks and quarterly thereafter","B":"Monitor fasting blood glucose at baseline, 12 weeks, and annually","C":"Monitor fasting lipid profile at baseline, 12 weeks, and annually","D":"Monitor BP at baseline, 12 weeks, and annually","E":"Monitor TSH at baseline and annually"},"correct_answer":"E","explanation":"TSH is not monitored as part of routine metabolic monitoring guidelines."},{"number":132,"question":"Which of the following medications carries a black box warning for suicidal thinking and behavior (suicidality) in adults?","options":{"A":"Risperidone","B":"Ziprasidone","C":"Aripiprazole","D":"Olanzapine","E":"All of the above"},"correct_answer":"C","explanation":"Aripiprazole carries a black box warning for suicide risk as it is approved for use as an adjunctive treatment to antidepressants in major depressive disorder."},{"number":133,"question":"What should be your next best step for a patient with schizophrenia who has a history of failed trials with certain antipsychotics?","options":{"A":"Increase the dose of risperidone to 3 mg twice a day","B":"Stop risperidone and start Olanzapine","C":"Continue the same dose of risperidone","D":"Taper Risperidone as you start olanzapine 5 mg at bedtime","E":"Refer for electroconvulsive therapy (ECT)"},"correct_answer":"C","explanation":"Antipsychotic trials should be of sufficient duration to allow for maximum benefit, which usually ranges from 4 to 6 weeks."},{"number":134,"question":"Which of the following benzodiazepines has the shortest half-life?","options":{"A":"Flurazepam","B":"Triazolam","C":"Temazepam","D":"Clonazepam","E":"Diazepam"},"correct_answer":"B","explanation":"Triazolam has a very short half-life (<4 hours)."},{"number":135,"question":"Atypical antipsychotics increase the risk of which of the following?","options":{"A":"Type 2 diabetes mellitus","B":"Weight gain","C":"Risk of strokes in elderly patients","D":"Hyperlipidemia","E":"All of the above"},"correct_answer":"E","explanation":"Atypical antipsychotics are known to increase the risk of type 2 diabetes mellitus, weight gain, strokes in elderly patients, and hyperlipidemia."},{"number":136,"question":"Which of the following is the most likely cause for the emergence of ataxia, slurred speech, and confusion in a patient on alprazolam and Divalproex?","options":{"A":"Alprazolam toxicity","B":"Carbamazepine discontinuation syndrome","C":"Disseminated intravascular coagulation secondary to Divalproex-induced thrombocytopenia","D":"Complex partial seizures","E":"Transient ischemic attack (TIA)"},"correct_answer":"A","explanation":"The patient is most likely experiencing alprazolam toxicity due to DDI between carbamazepine and alprazolam."},{"number":137,"question":"Which of the following antipsychotic medications has the highest selectivity and potency for dopamine D2 receptors?","options":{"A":"Quetiapine","B":"Pimozide","C":"Loxapine","D":"Thioridazine","E":"Ziprasidone"},"correct_answer":"B","explanation":"Pimozide is highly selective blocker of dopamine D2 receptors."},{"number":138,"question":"The potential cause of sleepwalking as a side effect of Zolpidem is because of which of the following effects?","options":{"A":"Increased REM sleep","B":"Decreased REM sleep","C":"Increased slow-wave sleep","D":"Decreased slow-wave sleep","E":"Increased REM latency"},"correct_answer":"C","explanation":"Zolpidem increases slow-wave sleep that may cause rare side effects such as sleepwalking."},{"number":139,"question":"Which of the following statements regarding Topiramate is true?","options":{"A":"Topiramate is a carbonic anhydrase inhibitor","B":"Topiramate can cause metabolic alkalosis as a side effect","C":"Topiramate is efficacious in bipolar mania","D":"Topiramate increases intestinal absorption of calcium and thus causing renal stones","E":"Topiramate is not efficacious in prophylaxis of migraine headaches"},"correct_answer":"A","explanation":"Topiramate is a carbonic anhydrase inhibitor."},{"number":140,"question":"Among the following diuretic agents, which one can affect lithium levels the most?","options":{"A":"Furosemide","B":"Mannitol","C":"Hydrochlorothiazide","D":"Spironolactone","E":"Atenolol"},"correct_answer":"C","explanation":"Thiazides like Hydrochlorothiazide increase reabsorption of lithium, leading to increased lithium levels."},{"number":141,"question":"Symptoms arising from which of the following organ systems is a key differentiating factor between the hypertensive reaction and histamine headache, both of which can occur with an MAOI?","options":{"A":"GI system","B":"Ocular","C":"Vascular system","D":"CNS","E":"Endocrine system"},"correct_answer":"C","explanation":"The hypertensive crisis is characterized by symptoms arising from the vascular system due to dietary amines."},{"number":142,"question":"Weight gain, a side effect with mirtazapine therapy, is mediated through the blockade of which of the following receptors?","options":{"A":"5-HT2A","B":"5-HT2C and H1 histaminergic","C":"5-HT3","D":"M muscarinic","E":"All of the above"},"correct_answer":"B","explanation":"Antagonism of 5-HT2C and H1 receptors can increase appetite and lead to weight gain during mirtazapine therapy."},{"number":143,"question":"Which of the following is the best explanation for a patient's sleep attack induced by pramipexole?","options":{"A":"Narcolepsy","B":"Drug-induced sleep attack","C":"Conversion disorder","D":"Panic attack","E":"Excessive daytime sedation with pramipexole"},"correct_answer":"B","explanation":"The patient's symptoms are most likely due to a side effect from pramipexole."},{"number":144,"question":"Buspirone is more advantageous compared with benzodiazepines in which of the following clinical aspects?","options":{"A":"Convenience of once a day dosing","B":"Provides rapid relief from anxiety symptoms","C":"Has low risk for abuse","D":"Can be used to augment antipsychotics drugs","E":"All of the above"},"correct_answer":"C","explanation":"Buspirone has a low risk for abuse but does not provide rapid relief or is used for augmenting antipsychotics."},{"number":145,"question":"Which of the following statements regarding TCAs are/is true?","options":{"A":"Amitriptyline has maximal anticholinergic property among the Tricyclics.","B":"Desipramine has the least anticholinergic property among the Tricyclics.","C":"Doxepin has potent H1 antagonistic properties.","D":"Nortriptyline has a curvilinear therapeutic window.","E":"All of the above"},"correct_answer":"E","explanation":"All statements are true regarding TCAs."},{"number":146,"question":"All of the following are risk factors for NMS EXCEPT:","options":{"A":"Dehydration","B":"Agitation","C":"Low serum iron","D":"Potency of neuroleptic","E":"None of the above"},"correct_answer":"E","explanation":"None of the above can be excluded as risk factors for NMS."},{"number":147,"question":"Which of the following is the best-studied medication till date for borderline personality disorder (BPD)?","options":{"A":"Fluoxetine","B":"Divalproex sodium","C":"Aripiprazole","D":"Lamotrigine","E":"Quetiapine"},"correct_answer":"A","explanation":"SSRIs are recommended as first-line treatments for affective instability and impulse control in BPD, with fluoxetine being the most studied."},{"number":148,"question":"Which of the following antidepressants has the most evidence for safety during breastfeeding?","options":{"A":"Citalopram","B":"Venlafaxine","C":"Bupropion","D":"Nortriptyline","E":"Paroxetine"},"correct_answer":"E","explanation":"Paroxetine and sertraline are considered first-line medications in women who wish to continue breastfeeding."},{"number":149,"question":"Which of the following antidepressants has significant secondary benefits as an antipruritic agent?","options":{"A":"Doxepin","B":"Mirtazapine","C":"Nortriptyline","D":"Paroxetine","E":"Desipramine"},"correct_answer":"A","explanation":"Doxepin has potent anti-histaminergic properties, making it useful in managing pruritus."},{"number":150,"question":"Which of the following is the best established non-psychiatric use of lithium?","options":{"A":"Treatment of cluster headaches","B":"Reducing chemotherapy-associated neutropenia","C":"Reducing hematopoietic toxicity associated with zidovudine use","D":"Treatment of herpes simplex infections","E":"Treatment of the syndrome of inappropriate secretion of antidiuretic hormone (SIADH)"},"correct_answer":"A","explanation":"Lithium is very effective for the prophylaxis of cluster headaches."}]`);export{e as default};
